import AppLayout from "../components/AppLayout";
import Head from "next";

const Signup = () => {
    return(
        <>
         <Head>
            <title>회원가입 | sns</title>
        </Head>
        <AppLayout>
        <div>회원가입 페이지</div>
        </AppLayout>
        </>
    )
}

export default Signup;
